function InputBox(){
    const [name, setName] = useState("");

  return (
    <div>
      <h1>NET FORCE</h1>
    <form>
      <label>Enter your name:
        <input
          type="text" 
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
      </label>
    </form>
    </div>
  )
}
export default InputBox;
